import Task from './Task'
[{ description: "" }]
const TaskList = ({ tasks = [] }) => {


  return (
    <ul class="todo-list">
      {tasks.map(() =>{
        return <Task
          description="description 1"
          completed={true}
          created="created 17 seconds ago"
          onEdit={() => {
            console.log("edit task 1");
          }}
          onDelete={() => {
            console.log("delete task 1");
          }}
        />}
      )}

      <Task description="description 2" completed={false} created="created 20 seconds ago" />
      <Task description="description 3" completed={true} created="created 50 seconds ago" />
      <Task description="description 4" completed={false} created="created 1 seconds ago" />
    </ul>
  )
}

export default TaskList;
